INSERT INTO `archivo` (`id`, `titulo`, `descripcion`, `imagen`, `fecha`) VALUES
(1, 'La Feria de la Ciencia Despierta el Interés por la Investigación', 'Este pasado viernes, nuestra escuela fue el escenario de la esperada Feria de la Ciencia, un evento que reunió a estudiantes de todas las edades para mostrar sus proyectos innovadores y despertar el interés por la investigación científica.  La feria comenzó a las 9 de la mañana y se extendió a lo largo del día, atrayendo a estudiantes, profesores y padres. Los pasillos se llenaron de color y entusiasmo mientras los alumnos presentaban sus experimentos y descubrimientos. Desde proyectos sobre energías renovables hasta investigaciones sobre la contaminación del agua, la creatividad y el esfuerzo de los estudiantes se hicieron evidentes.  Uno de los proyectos más destacados fue el de Ana Martínez y Luis Pérez, quienes desarrollaron un sistema de filtración de agua utilizando materiales reciclados. \"Queremos demostrar que podemos cuidar nuestro planeta con soluciones sencillas\", explicaron l', 0x31303146432e6a7067, '2024-10-21 13:10:43'),
(2, 'Día del Deporte: Una Jornada de Diversión y Competencia en la Escuela', 'El pasado jueves, nuestra escuela celebró el Día del Deporte, un evento que unió a estudiantes, profesores y padres en una jornada llena de actividad física y camaradería. Desde las primeras horas de la mañana, el ambiente se llenó de energía mientras los estudiantes participaban en diversas competencias deportivas.  Las actividades incluyeron carreras de relevos, torneos de fútbol y baloncesto, además de juegos tradicionales como la cuerda y el pañuelo. Los alumnos mostraron su espíritu competitivo y, al mismo tiempo, su compañerismo, animando a sus compañeros en cada prueba.  La profesora de educación física, Marta Gómez, comentó: \"El objetivo de este día es fomentar la actividad física y el trabajo en equipo. Ver a los estudiantes disfrutar y colaborar es lo más gratificante\".', 0x6469612d66616d696c69612d6465706f727465312d31313730783536382e6a7067, '2024-10-21 13:13:03'),
(3, 'El Último Viaje de Luna', 'Luna era una gata de pelaje suave y ojos brillantes, conocida en su vecindario por su curiosidad insaciable. Cada día, exploraba cada rincón del jardín, persiguiendo mariposas y tomando siestas bajo el sol. Pero, había un lugar que nunca había osado visitar: el viejo bosque al final de la calle.  Una mañana, impulsada por un extraño deseo de aventura, decidió que era el día perfecto para explorar el bosque. Con un salto decidido, cruzó la calle y se adentró entre los árboles. A medida que avanzaba, los sonidos familiares de la ciudad se desvanecían, reemplazados por el susurro del viento y el canto de los pájaros.  Luna se sintió pequeña en ese vasto mundo verde, pero también emocionada. Siguió un sendero cubierto de hojas, donde el sol se filtraba a través de las ramas. En su camino, descubrió un claro lleno de flores de colores vivos y mariposas danzantes. Fue allí donde encontró a un ', '', '2024-10-21 13:21:13'),
(4, ' Diversión y Competencia ', 'Luna era una gata de pelaje suave y ojos brillantes, conocida en su vecindario por su curiosidad insaciable. Cada día, exploraba cada rincón del jardín, persiguiendo mariposas y tomando siestas bajo el sol. Pero, había un lugar que nunca había osado visitar: el viejo bosque al final de la calle.  Una mañana, impulsada por un extraño deseo de aventura, decidió que era el día perfecto para explorar el bosque. Con un salto decidido, cruzó la calle y se adentró entre los árboles. A medida que avanzaba, los sonidos familiares de la ciudad se desvanecían, reemplazados por el susurro del viento y el canto de los pájaros.  Luna se sintió pequeña en ese vasto mundo verde, pero también emocionada. Siguió un sendero cubierto de hojas, donde el sol se filtraba a través de las ramas. En su camino, descubrió un claro lleno de flores de colores vivos y mariposas danzantes. Fue allí donde encontró a un ', '', '2024-10-21 13:21:50'),
(5, 'REFLEXIÓN', 'A veces, la vida nos invita a salir de nuestra zona de confort. Como Luna, que se aventuró en el bosque, cada pequeño paso hacia lo desconocido puede abrirnos a nuevas experiencias y aprendizajes. Enfrentar nuestros miedos nos permite descubrir no solo el mundo que nos rodea, sino también nuestra propia valentía. La curiosidad y el deseo de explorar son esenciales para crecer.', '', '2024-10-21 13:22:29');

