(3, 'REFLEXIÓN', '', 'A veces, la vida nos invita a salir de nuestra zona de confort. Como Luna, que se aventuró en el bosque, cada pequeño paso hacia lo desconocido puede abrirnos a nuevas experiencias y aprendizajes. Enfrentar nuestros miedos nos permite descubrir no solo el mundo que nos rodea, sino también nuestra propia valentía. La curiosidad y el deseo de explorar son esenciales para crecer.');

